(85, 2, 1233, 'Testing Call', 'consent-forms/d1nmipCimJUANKspcbiZ8GCfNBW4T1zTlKnx0Ei1.pdf', 'Let\'s walk through this together, step by step.', 'Script Generated', 1, '{\"id\":\"chatcmpl-BkVpSDwUtKXcgDbGEsx2OGBEghw7K\",\"object\":\"chat.completion\",\"created\":1750425138,\"model\":\"gpt-4-0125-preview\",\"choices\":[{\"index\":0,\"message\":{\"role\":\"assistant\",\"content\":\"Hi there! Welcome to your guide on postoperative care after breast surgery. We\'re here to make sure you have all the information you need for a smooth and comfortable recovery. Let\'s walk through this together, step by step.\\n\\n**Two Weeks Before Surgery:**\\n- It\'s time to stop smoking or vaping, including nicotine-free options.\\n- Please avoid certain over-the-counter vitamins and supplements like Ginger, Garlic, and a few others listed in your document.\\n- Also, halt NSAIDs \\u2014 that\'s your Ibuprofen and similar medications.\\n- If you\'re on birth control, hormone replacement, or weight loss medication, our staff needs to know.\\n- Remember, you\'ll need someone over 18 to drive you to and from your surgery and stick around for the first 24 hours afterward.\\n\\n**Morning of Surgery:**\\n- Don\'t eat or drink unless we\'ve told you otherwise.\\n- Start using Hibiclens antibacterial soap 5 days before surgery for your shower. Skip the lotion, deodorant, makeup, and remove any metal jewelry.\\n- Wear comfy clothes that are easy to change, like a button-up or zip front top.\\n- Bring all medications prescribed by Dr. Paul to the surgery.\\n\\n**After Surgery:**\\n- You\'ll get a call from our nurse or tech the next day.\\n- Physical activity should be light but try not to stay in bed all day. Gentle walking is good, but no heavy lifting or strenuous activities for 6 weeks.\\n- For personal hygiene, you can shower from the first postoperative day but avoid hot baths or swimming pools for 6 weeks.\\n\\n**Dressings and Surgical Bra:**\\n- Keep your surgical tape on until your follow-up visit unless it falls off.\\n- Wear your surgical bra day and night until your 6 week check-up.\\n\\n**Wound Care:**\\n- Keep the incisions covered until they stop bleeding. If an incision opens slightly, clean it with hydrogen peroxide, apply ointment, and cover it with a dry dressing.\\n\\n**Drain Care:**\\n- If you have a drain, you\'ll need to keep track of the output. This helps us know when it\'s safe to remove the drain.\\n\\n**Questions and Emergencies:**\\n- If you have any questions or concerns, we\'re here for you. For non-emergencies, you can call or email us. For emergencies, we\'ve provided specific contact numbers, but remember, in a severe emergency, call 911.\\n\\n**Pain Management:**\\n- We\'re careful with narcotics due to new regulations. You\'ll be advised on alternative pain relief methods, like Tylenol or Advil. Remember, narcotics can cause constipation, so stay hydrated and consider a stool softener if needed.\\n\\n**Follow-Up Visits:**\\n- Your recovery journey includes follow-up visits at 1 week, 6 weeks, 6 months, and 1 year post-surgery to ensure everything is healing nicely.\\n\\nPlease be patient with your healing process, and remember, we\'re here to support you every step of the way. Don\'t hesitate to reach out with any questions or concerns. \\n\\nAnd that\'s it! Please make sure to review all the detailed instructions provided to you, and we look forward to seeing you at your next appointment. Take care!\",\"refusal\":null,\"annotations\":[]},\"logprobs\":null,\"finish_reason\":\"stop\"}],\"usage\":{\"prompt_tokens\":2697,\"completion_tokens\":670,\"total_tokens\":3367,\"prompt_tokens_details\":{\"cached_tokens\":0,\"audio_tokens\":0},\"completion_tokens_details\":{\"reasoning_tokens\":0,\"audio_tokens\":0,\"accepted_prediction_tokens\":0,\"rejected_prediction_tokens\":0}},\"service_tier\":\"default\",\"system_fingerprint\":null}', 14, '2025-06-20 13:12:17', '2025-06-20 13:13:02', NULL, NULL, NULL, NULL),
(86, 2, 1233, 'Test Game', 'consent-forms/QaVp1qokpBtf47N7sNCg1swwUSdIpNfhsoD32W8S.pdf', '**Before Surgery Prep**\n- Let’s start with what to do two weeks before your surgery. It’s crucial to stop smoking or vaping, including nicotine-free options.', 'sent', 3, '{\"id\":\"chatcmpl-BkVuHw3n7yOIMPX1PHnH4R0wsKpQr\",\"object\":\"chat.completion\",\"created\":1750425437,\"model\":\"gpt-4-0125-preview\",\"choices\":[{\"index\":0,\"message\":{\"role\":\"assistant\",\"content\":\"Hi there! Today, we\'re going to walk you through what to expect and how to care for yourself after your breast surgery. It\\u2019s important to us that you feel prepared and confident throughout your recovery process.\\n\\n**Before Surgery Prep**\\n- Let\\u2019s start with what to do two weeks before your surgery. It\\u2019s crucial to stop smoking or vaping, including nicotine-free options. Also, pause any over-the-counter vitamins or supplements like ginger, garlic, and fish oil, among others. \\n- Avoid NSAIDs like Ibuprofen and Aspirin. If you\\u2019re on birth control, hormone replacements, or weight loss medication, please tell our staff. \\n- You\\u2019ll need someone over 18 to drive you to and from the surgery and stay with you for the first 24 hours.\\n\\n**Morning of Surgery**\\n- On the big day, don\\u2019t eat or drink unless we\\u2019ve given you specific instructions otherwise. Start using Hibiclens antibacterial soap 5 days before surgery, but skip lotions and makeup. \\n- Remove all metal jewelry and switch to glasses if you wear contact lenses. Wear comfy clothes, ideally with a front opening.\\n- Bring all medications prescribed by Dr. Paul with you.\\n\\n**The Day After Surgery**\\n- Expect a call from our nurse or tech to check in on you.\\n\\n**Physical Activity**\\n- Don\\u2019t stay in bed all day. Move around gently but avoid any vigorous activity for 6 weeks. Be careful when lifting, especially infants or small children, and avoid driving while on narcotic pain medicine.\\n\\n**Personal Hygiene**\\n- You can shower from the first postoperative day but keep it warm, not hot. Be cautious when washing your hair or reaching up.\\n\\n**Dressings and Surgical Bra**\\n- Keep the tape over your incisions until your follow-up visit, unless it falls off. Wear your surgical bra day and night for 6 weeks, and avoid underwire bras until we say it\\u2019s okay.\\n\\n**Wound Care**\\n- Cover your incisions with gauze until they stop bleeding. For any minor wound issues, clean with hydrogen peroxide, apply bacitracin ointment, and cover with dry gauze.\\n\\n**If You Have a Drain**\\n- If applicable, we\\u2019ll show you how to care for any drains.\\n\\n**Questions or Concerns**\\n- We\\u2019re here for you. For any questions, call or text our office, or email us. For emergencies, you have Dr. Paul\\u2019s and Katie\\u2019s personal numbers.\\n\\nRemember, recovery takes time. Swelling and some discomfort are normal, and we\\u2019re committed to supporting you every step of the way. For any severe symptoms like difficulty breathing or chest pain, call 911.\\n\\nFollow-up visits are scheduled for 1 week, 6 weeks, 6 months, and 1 year post-surgery to ensure everything is healing as it should.\\n\\nLastly, don\\u2019t forget to pick up some maxi pads for dressing changes, Miralax to prevent constipation, and paper tape for your incisions.\\n\\nNow that you\'ve heard this summary, please make sure to review the full document before your surgery. Your health and comfort are our top priorities, and knowing what to expect can really make a difference. Thank you for choosing Virtu Cosmetic Surgery. We\\u2019re looking forward to seeing you soon!\",\"refusal\":null,\"annotations\":[]},\"logprobs\":null,\"finish_reason\":\"stop\"}],\"usage\":{\"prompt_tokens\":2697,\"completion_tokens\":672,\"total_tokens\":3369,\"prompt_tokens_details\":{\"cached_tokens\":0,\"audio_tokens\":0},\"completion_tokens_details\":{\"reasoning_tokens\":0,\"audio_tokens\":0,\"accepte