(89, 2, 1233, 'Dr Paul Test 20', 'consent-forms/L43YdNEigIXvfxVqI2z1zxzvC7rfLm9hwLJVkCTm.pdf', 'Let\'s dive in!', 'Script Generated', 1, '{\"id\":\"chatcmpl-BkaTJZT0b2cs3CgGh6U9onCPUl0eK\",\"object\":\"chat.completion\",\"created\":1750442985,\"model\":\"gpt-4-0125-preview\",\"choices\":[{\"index\":0,\"message\":{\"role\":\"assistant\",\"content\":\"Hi there! Welcome to your guide on what to expect and how to prepare for your breast surgery, as well as how to take care of yourself afterward. We want to make sure you have all the information you need in a clear and friendly way. Let\'s dive in!\\n\\n**Before Your Surgery - Two Weeks Prior:**\\n- Please stop all smoking and vaping, including nicotine-free options.\\n- Avoid certain over-the-counter vitamins and supplements like ginger, garlic, and a few others listed in your document.\\n- It\'s important to stop taking NSAIDs - those are common pain relievers like Ibuprofen and Aspirin.\\n- Let our staff know if you\'re on birth control, hormone replacements, or any weight loss supplements.\\n- And very importantly, you\'ll need a responsible adult to drive you to and from surgery and stay with you for the first 24 hours afterward.\\n\\n**The Morning Of Your Surgery:**\\n- Don\'t eat or drink before surgery unless we tell you otherwise.\\n- Shower with antibacterial soap for 5 days leading up to the surgery, but skip the lotions and make-up.\\n- Leave your jewelry and contact lenses at home, and wear something comfortable with a front opening.\\n- Bring all medications prescribed by your doctor.\\n\\n**After Your Surgery:**\\n- The day after, expect a call from our nurse or tech to check on you.\\n- Keep moving within comfort, but avoid strenuous activities for 6 weeks.\\n- Be cautious with personal hygiene; showers are okay, but no baths or swimming for 6 weeks.\\n- Follow specific instructions for dressing your wound and managing any drains if you have them.\\n\\n**Surgical Bra:**\\n- Wear it day and night until your 6-week check-up. After that, you can switch to a regular bra without underwire until instructed otherwise.\\n\\n**Wound Care:**\\n- Keep the area clean and covered as directed. Don\\u2019t be alarmed by minor wound issues; just clean them as we\'ve advised and contact us if you have any concerns.\\n\\n**Pain Management:**\\n- We\\u2019re careful with narcotics due to regulations. You\'ll likely use over-the-counter options like Tylenol or Advil as instructed.\\n- Remember, narcotics can cause constipation, so stay hydrated and may need a stool softener.\\n\\n**Emergency Contacts:**\\n- We\'ve provided numbers for non-emergency questions and emergencies. Don\\u2019t hesitate to reach out if you need us.\\n\\n**Follow-Up Visits:**\\n- You\\u2019ll have appointments at 1 week, 6 weeks, 6 months, and 1 year post-surgery to ensure everything is healing nicely.\\n\\n**Additional Tips:**\\n- Patience is key! Swelling and some discomfort are normal, but they will improve.\\n- Pick up some supplies like maxi pads for dressing changes, Miralax, and paper tape for incision care.\\n\\nRemember, we\\u2019re here to make your experience as smooth and comfortable as possible. Please review all the detailed instructions provided and don\\u2019t hesitate to contact us with any questions or concerns. Your health and satisfaction are our top priorities.\\n\\nNow that you\'ve got the overview, please make sure to review the full document or instructions provided to you before your surgery. Take care, and we look forward to supporting you through this journey!\",\"refusal\":null,\"annotations\":[]},\"logprobs\":null,\"finish_reason\":\"stop\"}],\"usage\":{\"prompt_tokens\":2697,\"completion_tokens\":662,\"total_tokens\":3359,\"prompt_tokens_details\":{\"cached_tokens\":0,\"audio_tokens\":0},\"completion_tokens_details\":{\"reasoning_tokens\":0,\"audio_tokens\":0,\"accepted_prediction_tokens\":0,\"rejected_prediction_tokens\":0}},\"service_tier\":\"default\",\"system_fingerprint\":null}', 20, '2025-06-20 18:09:44', '2025-06-22 12:35:42', NULL, NULL, NULL, NULL),
(91, 2, 1233, 'Dr Paul Test 22', 'consent-forms/2nzg8GAtQDrAjHAxjyTryFRaV9sN0pW4NUD99mU3.pdf', 'Today, we\'re here to guide you through your postoperative care instructions', 'Script Generated', 1, '{\"id\":\"chatcmpl-BkadjPY3Li2ijrWeDMptViar3aMrr\",\"object\":\"chat.completion\",\"created\":1750443631,\"model\":\"gpt-4-0125-preview\",\"choices\":[{\"index\":0,\"message\":{\"role\":\"assistant\",\"content\":\"Hi there! Today, we\'re here to guide you through your postoperative care instructions after breast surgery. It\'s important to follow these steps closely to ensure the best possible outcome and a smooth recovery. Let\'s break it down into simple, easy-to-follow parts.\\n\\n**Before Surgery Prep:**  \\n- Starting two weeks before surgery, please stop all smoking or vaping, including nicotine-free vaping.  \\n- Avoid certain over-the-counter vitamins and supplements, such as those containing Ginger, Garlic, Ginkgo Biloba, Ginseng, Fish Oil\\/Omega 3, and Turmeric.  \\n- Please stop taking any NSAIDs like Ibuprofen or Aspirin.  \\n- Let our staff know if you\'re on any birth control, hormone replacements, or weight loss supplements.  \\n- It\'s essential to have someone over 18 drive you to and from surgery and stay with you for the first 24 hours post-procedure.\\n\\n**Morning Of Surgery:**  \\n- Don\'t eat or drink unless our staff advises otherwise.  \\n- Use Hibiclens antibacterial soap for a shower, avoiding lotions or makeup, and remove all metal items.  \\n- Wear something comfortable that zips or buttons up front.  \\n- Bring all medications prescribed by Dr. Paul.\\n\\n**After Surgery:**  \\n- Stay active but avoid strenuous activities and lifting heavy objects for 6 weeks.  \\n- For personal hygiene, take warm showers, but avoid baths or swimming pools to prevent infection.  \\n- Keep your surgical bra on at all times until your 6-week post-op visit, and avoid underwire bras until cleared by staff.\\n\\n**Wound Care:**  \\n- Keep the incisions covered with gauze until there\\u2019s no more bleeding. If you notice any opening or yellow discharge, clean with hydrogen peroxide, apply ointment, and cover with dry gauze.  \\n- Hands should be washed before applying any dressings.\\n\\n**Pain Management:**  \\n- We will not refill narcotic medications. For pain, you may take Tylenol or Ibuprofen as instructed, but please manage dosage carefully.  \\n- Stay hydrated and consider a stool softener to prevent constipation from narcotic pain medicine.\\n\\n**Emergency Contacts:**  \\n- For non-emergencies, you can call or email our office. For emergencies, Dr. Paul and Katie have provided personal contact numbers. Please use these responsibly.\\n\\n**Follow-Up Visits:**  \\n- You will have postoperative visits at 1 week, 6 weeks, 6 months, and 1 year to ensure everything is healing as it should.\\n\\nRemember, swelling and some discomfort are normal, but they will improve over time. Patience is key. \\n\\nDon\'t hesitate to contact us with any questions or concerns. We\'re here to make your recovery as comfortable and successful as possible.\\n\\nPlease review all the details we\'ve discussed before your surgery. We look forward to seeing you soon and are here to support you every step of the way. Take care!\",\"refusal\":null,\"annotations\":[]},\"logprobs\":null,\"finish_reason\":\"stop\"}],\"usage\":{\"prompt_tokens\":2697,\"completion_tokens\":606,\"total_tokens\":3303,\"prompt_tokens_details\":{\"cached_tokens\":0,\"audio_tokens\":0},\"completion_tokens_details\":{\"reasoning_tokens\":0,\"audio_tokens\":0,\"accepted_prediction_tokens\":0,\"rejected_prediction_tokens\":0}},\"service_tier\":\"default\",\"system_fingerprint\":null}', 17, '2025-06-20 18:20:30', '2025-06-20 18:21:12', NULL, NULL, NULL, NULL),
