(105, 2, 1233, 'Test Test', 'consent-forms/GyPGKtUblKvSqbDPpXcliWixvvlAqAB8zeNpgGSX.pdf', 'Hi there! Today, we’re going to walk through what you need to know about getting Breast Augmentation with Silicone Gel-Filled Implants. It\'s important to us that you feel informed and comfortable with your decision, so let’s dive in.\n\nFirst off, breast augmentation is a procedure to enhance the size and shape of your breasts for various personal or medical reasons. It\'s been approved by the FDA, but like any surgery, it comes with its risks and considerations. If you\'re over 22, you\'re eligible for this cosmetic surgery, but it\'s crucial you\'re aware of what it entails.\n\nYour surgeon will place the implant behind your breast tissue or under your chest muscle, making careful incisions to minimize visible scarring. There are many types of implants and surgical techniques, and your surgeon will recommend what\'s best based on your body and goals. Remember, achieving symmetry or correcting severe breast abnormalities might involve additional procedures, like a breast lift.\n\nIt\'s essential to understand that breast implants are not lifetime devices. You might need future surgeries for replacement or removal, and there are risks of complications over time. Also, large implants can bring their own set of challenges, from aesthetic issues to more serious concerns like infection.\n\nThere are alternatives to silicone implants, such as saline implants or not having surgery at all. Each option has its own set of risks and benefits, which you should discuss with your surgeon.\n\nSpecific risks of silicone implants include the possibility of implant rupture, capsular contracture (where scar tissue around the implant tightens), and changes in nipple and breast sensation, among others. In rare cases, a type of cancer called Breast Implant-Associated Anaplastic Large Cell Lymphoma (BIA-ALCL) has been reported.\n\nRegular monitoring post-surgery, through self-exams and medical check-ups, is crucial for your health. Also, understand that future pregnancies or breast cancer risk are important considerations.\n\nBefore you decide, know this is your choice. Our goal is to ensure you\'re making an informed decision that\'s right for you. Please make sure to ask your surgeon any and all questions you might have.\n\nNow that you’ve heard the summary, please make sure to review the full document before signing. It\'s important that you feel fully informed and confident in your decision.\n\n---\n\n\"key_sections\": [\n  {\n    \"section_name\": \"Introduction\",\n    \"pdf_text\": \"This is an informed consent document to help you understand your breast implant surgery better.\",\n    \"start_time\": 0,\n    \"end_time\": 10\n  },\n  {\n    \"section_name\": \"Procedure Details\",\n    \"pdf_text\": \"In this surgery, a surgeon will place a breast implant behind your natural breast tissue or under the muscles of your chest to increase the size of the breast.\",\n    \"start_time\": 10,\n    \"end_time\": 20\n  },\n  {\n    \"section_name\": \"Risks and Alternatives\",\n    \"pdf_text\": \"Nobreastimplantslastalifetime. You may require surgery in future to replace or remove your implants. Alternatives include not having surgery at all or using saline-filled breast implants.\",\n    \"start_time\": 20,\n    \"end_time\": 40\n  },\n  {\n    \"section_name\": \"Specific Risks\",\n    \"pdf_text\": \"Specific risks of silicone gel-filled breast implants include the possibility of implant rupture, capsular contracture, and changes in nipple and skin sensation, among others.\",\n    \"start_time\": 40,\n    \"end_time\": 60\n  },\n  {\n    \"section_name\": \"Monitoring and Health Considerations\",\n    \"pdf_text\": \"Regular monitoring post-surgery, through self-exams and medical check-ups, is crucial for your health.\",\n    \"start_time\": 60,\n    \"end_time\": 70\n  },\n  {\n    \"section_name\": \"Conclusion and Consent\",\n    \"pdf_text\": \"Before you decide, know this is your choice. Our goal is to ensure you\'re making an informed decision that\'s right for you.\",\n    \"start_time\": 70,\n    \"end_time\": 80\n  }\n]', 'Script Generated', 1, '{\"id\":\"chatcmpl-Br0r7JZWv25NtexjIt46aLdhjLxfB\",\"object\":\"chat.completion\",\"created\":1751974373,\"model\":\"gpt-4-0125-preview\",\"choices\":[{\"index\":0,\"message\":{\"role\":\"assistant\",\"content\":\"Hi there! Today, we\\u2019re going to walk through what you need to know about getting Breast Augmentation with Silicone Gel-Filled Implants. It\'s important to us that you feel informed and comfortable with your decision, so let\\u2019s dive in.\\n\\nFirst off, breast augmentation is a procedure to enhance the size and shape of your breasts for various personal or medical reasons. It\'s been approved by the FDA, but like any surgery, it comes with its risks and considerations. If you\'re over 22, you\'re eligible for this cosmetic surgery, but it\'s crucial you\'re aware of what it entails.\\n\\nYour surgeon will place the implant behind your breast tissue or under your chest muscle, making careful incisions to minimize visible scarring. There are many types of implants and surgical techniques, and your surgeon will recommend what\'s best based on your body and goals. Remember, achieving symmetry or correcting severe breast abnormalities might involve additional procedures, like a breast lift.\\n\\nIt\'s essential to understand that breast implants are not lifetime devices. You might need future surgeries for replacement or removal, and there are risks of complications over time. Also, large implants can bring their own set of challenges, from aesthetic issues to more serious concerns like infection.\\n\\nThere are alternatives to silicone implants, such as saline implants or not having surgery at all. Each option has its own set of risks and benefits, which you should discuss with your surgeon.\\n\\nSpecific risks of silicone implants include the possibi