(108, 2, 1233, 'hjbbhb', 'consent-forms/QJ0T5zHWDGQHWkX3piFMnwSNYhVIScoc6HBgYdt8.pdf', 'Hi there! Today, I\'ll guide you through the user manual in a way that\'s easy to understand, so you know exactly what steps to take, whether you\'re adding data, verifying it, or registering as a student. Let\'s dive in!\n\nFirst up, if you\'re looking to add or verify data for colleges, courses, or students, you\'ll start by logging in with your specific credentials provided by the department. Once logged in, you\'ll land on your role-based default page.\n\n**For UNMKR Roles: Adding Data**\n\n- **Adding a College**: Simply click on the \'College\' tab, then \'Add College\'. Fill in the college\'s details, like name, type, AISHE code, and address, and hit \'Save\'.\n- **Adding a Course**: Head over to the \'Course\' tab, select \'Add Course Detail\', and follow the prompts to add courses for a specific academic session and college.\n- **Adding a Student**: In the \'Student\' tab, you\'ll find \'Upload Student Detail\'. Choose the correct Excel file with student details in the prescribed format and upload it. After an internal validation, correct any errors shown and then upload the error-free data to the database.\n\n**For UNCHK Roles: Verifying Data**\n\n- **Approving Colleges and Courses**: Log in, navigate to the respective tabs, select the colleges or courses pending approval, and approve or correct them as necessary.\n- **Approving Students**: Under the \'Student\' tab, review the uploaded student details, approve them, or correct any ambiguities you find.\n\n**For Department Operators (DPTOPT): Approving Student Payments**\n\n- After logging in, click on the \'Payment\' tab, then \'Approve Student For Payment\'. Select the university, view the verified student list, and approve the students for payment processing.\n\n**For Students: Registration Process**\n\n- Start by clicking on the registration URL, enter your university registration number, father\'s name, and marksheet number. After verifying your details, proceed to verify your Aadhaar, mobile, and email through OTP authentication. Finally, enter your bank and residential details and click \'Register\'.\n\nRemember, before you hit that \'Register\' button, make sure all your details, including Aadhaar, mobile, and email, have been validated.\n\nNow that you\'ve got a clear overview, please make sure to review the full document for any specific details related to your role before proceeding. Happy navigating!\n\n\"key_sections\": [\n  {\n    \"section_name\": \"Introduction\",\n    \"pdf_text\": \"USER MANUAL\",\n    \"start_time\": 0,\n    \"end_time\": 10\n  },\n  {\n    \"section_name\": \"Adding Data (UNMKR Roles)\",\n    \"pdf_text\": \"Add College (UNMKR), Add Course (UNMKR), Add Student (UNMKR)\",\n    \"start_time\": 10,\n    \"end_time\": 40\n  },\n  {\n    \"section_name\": \"Verifying Data (UNCHK Roles)\",\n    \"pdf_text\": \"Approve College (UNCHK), Approve Course (UNCHK), Approve Student (UNCHK)\",\n    \"start_time\": 40,\n    \"end_time\": 70\n  },\n  {\n    \"section_name\": \"Approving Student Payments (DPTOPT)\",\n    \"pdf_text\": \"Approve Student(Payment) : (DPTOPT)\",\n    \"start_time\": 70,\n    \"end_time\": 85\n  },\n  {\n    \"section_name\": \"Student Registration Process\",\n    \"pdf_text\": \"Registration: (Student)\",\n    \"start_time\": 85,\n    \"end_time\": 120\n  }\n]', 'Script Generated', 1, '{\"id\":\"chatcmpl-Bv1YYHrdfxAoX1YC4K1V7rsbhBShN\",\"object\":\"chat.completion\",\"created\":1752930378,\"model\":\"gpt-4-0125-preview\",\"choices\":[{\"index\":0,\"message\":{\"role\":\"assistant\",\"content\":\"Hi there! Today, I\'ll guide you through the user manual in a way that\'s easy to understand, so you know exactly what steps to take, whether you\'re adding data, verifying it, or registering as a student. Let\'s dive in!\\n\\nFirst up, if you\'re looking to add or verify data for colleges, courses, or students, you\'ll start by logging in with your specific credentials provided by the department. Once logged in, you\'ll land on your role-based default page.\\n\\n**For UNMKR Roles: Adding Data**\\n\\n- **Adding a College**: Simply click on the \'College\' tab, then \'Add College\'. Fill in the college\'s details, like name, type, AISHE code, and address, and hit \'Save\'.\\n- **Adding a Course**: Head over to the \'Course\' tab, select \'Add Course Detail\', and follow the prompts to add courses for a specific academic session and college.\\n- **Adding a Student**: In the \'Student\' tab, you\'ll find \'Upload Student Detail\'. Choose the correct Excel file with student details in the prescribed format and upload it. After an internal validation, correct any errors shown and then upload the error-free data to the database.\\n\\n**For UNCHK Roles: Verifying Data**\\n\\n- **Approving Colleges and Courses**: Log in, navigate to the respective tabs, select the colleges or courses pending approval, and approve or correct them as necessary.\\n- **Approving Students**: Under the \'Student\' tab, review the uploaded student details, approve them, or correct any ambiguities you find.\\n\\n**For Department Operators (DPTOPT): Approving Student Payments**\\n\\n- After logging in, click on the \'Payment\' tab, then \'Approve Student For Payment\'. Select the university, view the verified student list, and approve the students for payment processing.\\n\\n**For Students: Registration Process**\\n\\n- Start by clicking on the registration URL, enter your university registration number, father\'s name, and marksheet number. After verifying your details, proceed to verify your Aadhaar, mobile, and email through OTP authentication. Finally, enter your bank and residential details and click \'Register\'.\\n\\nRemember, before you hit that \'Register\' button, make sure all your details, including Aadhaar, mobile, and email, have been validated.\\n\\nNow that you\'ve got a clear overview, please make sure to review the full document for any specific details related to your role before proceeding. Happy navigating!\\n\\n\\\"key_sections\\\": [\\n  {\\n    \\\"section_name\\\": \\\"Introduction\\\",\\n    \\\"pdf_text\\\": \\\"USER MANUAL\\\",\\n    \\\"start_time\\\": 0,\\n    \\\"end_time\\\": 10\\n  },\\n  {\\n    \\\"section_name\\\": \\\"Adding Data (UNMKR Roles)\\\",\\n    \\\"pdf_text\\\": \\\"Add College (UNMKR), Add Course (UNMKR), Add Student (UNMKR)\\\",\\n    \\\"start_time\\\": 10,\\n    \\\"end_time\\\": 40\\n  },\\n  {\\n    \\\"section_name\\\": \\\"Verifying Data (UNCHK Roles)\\\",\\n    \\\"pdf_text\\\": \\\"Approve College (UNCHK), Approve Course (UNCHK), Approve Student (UNCHK)\\\",\\n    \\\"start_time\\\": 40,\\n    \\\"end_time\\\": 70\\n  },\\n  {\\n    \\\"section_name\\\": \\\"Approving Student Payments (DPTOPT)\\\",\\n    \\\"pdf_text\\\": \\\"Approve Student(Payment) : (DPTOPT)\\\",\\n    \\\"start_time\\\": 70,\\n    \\\"end_time\\\": 85\\n  },\\n  {\\n    \\\"section_name\\\": \\\"Student Registration Process\\\",\\n    \\\"pdf_text\\\": \\\"Registration: (Student)\\\",\\n    \\\"start_time\\\": 85,\\n    \\\"end_time\\\": 120\\n  }\\n]\",\"refusal\":null,\"annotations\":[]},\"logprobs\":null,\"finish_reason\":\"stop\"}],\"usage\":{\"prompt_tokens\":1928,\"completion_tokens\":757,\"total_tokens\":2685,\"prompt_tokens_details\":{\"cached_tokens\":0,\"audio_tokens\":0},\"completion_tokens_details\":{\"reasoning_tokens\":0,\"audio_tokens\":0,\"accepted_prediction_tokens\":0,\"rejected_prediction_tokens\":0}},\"service_tier\":\"default\",\"system_fingerprint\":null}', NULL, '2025-07-19 13:06:17', '2025-07-19 13:06:45', NULL, NULL, NULL, '[{\"end_time\": 10, \"pdf_text\": \"USER MANUAL\", \"start_time\": 0, \"section_name\": \"Introduction\"}, {\"end_time\": 40, \"pdf_text\": \"Add College (UNMKR), Add Course (UNMKR), Add Student (UNMKR)\", \"start_time\": 10, \"section_name\": \"Adding Data (UNMKR Roles)\"}, {\"end_time\": 70, \"pdf_text\": \"Approve College 