(109, 2, 1233, 'jj', 'consent-forms/kMmuIrJA4tSuD6mODkjVAhPOW2EBk5JTth1uC0Cd.pdf', 'Hi there! Let\'s walk you through this agreement so you know exactly what to expect when using our system, whether you’re adding data, verifying it, or simply navigating through. Our goal is to make this process as smooth as possible for you.\n\n**For Users Adding Data (UNMKR):**\nFirst, you\'ll log in with the credentials provided to you based on your role. Once logged in, you can add colleges, courses, and student details. Adding a college involves entering details like the college name, type, AISHE code, and address before saving. For courses, select the academic session and college, then choose the faculty and subjects to add. When adding student details, you\'ll upload an excel sheet, validate the data, and address any errors before finalizing the upload.\n\n**For Users Verifying Data (UNCHK):**\nYour role kicks in after data has been added. You\'ll log in, navigate to the respective tab for colleges, courses, or students, and approve or correct the data. This might involve searching for pending items, selecting them, and either approving or correcting any errors found.\n\n**Department Operators (DPTOPT):**\nYour focus is on approving student payments. After logging in, you\'ll head to the payment tab, select the university, and then approve verified students for the payment process.\n\n**Students:**\nFor registration, you\'ll enter your university registration number, personal and contact details, and bank account information. Make sure your Aadhaar, mobile, and email details are validated before you hit the register button.\n\nNow that you\'ve heard the summary, please make sure to review the full document before signing. This ensures you’re fully aware of how to navigate the system, whether you’re adding, verifying, or submitting data.\n\n\"key_sections\": [\n  {\n    \"section_name\": \"Introduction\",\n    \"pdf_text\": \"Hi there! Let\'s walk you through this agreement so 