derstanding\"}]'),
(111, 2, 1233, 'edkn', 'consent-forms/f9ATJC3GSsY8KH82ksZIjhBlKXHe1fRD2jAEpMJ0.pdf', 'Hi there! Today, we\'re going to walk you through a user manual that outlines various actions such as adding and verifying data for colleges, courses, and students, all within a university setting. Whether you\'re a data marker (UNMKR), checker (UNCHK), department operator (DPTOPT), or even a student, this guide is designed to make your experience smooth and straightforward. Let\'s dive in!\n\n**For Data Markers and Checkers:**\n\n- **Logging In**: Start by clicking on the provided URL and log in with your username and password. This will take you to your role-based default page.\n\n- **Adding Colleges and Courses (UNMKR Role)**: To add a college or a course, simply find the College or Course tab, click on \"Add,\" and fill in the necessary details such as name, type, code, or academic session. For colleges, remember to input the AISHE code and the complete address.\n\n- **Approving Colleges and Courses (UNCHK Role)**: As a checker, you\'ll log in with your credentials, navigate to the Course tab, and then choose to approve colleges or courses. You can search for pending items, review them, and then approve or correct them as needed.\n\n- **Adding Students (UNMKR Role)**: To upload student details, head over to the Student tab, click on \"Upload Student Detail,\" and select the excel sheet with student information. The system will validate this data, and you can then upload it to the database. If there are errors, you\'ll have the chance to export, correct, and re-upload the data.\n\n- **Approving Students (UNCHK Role)**: For verifying student details, again, navigate to the Student tab and click on \"Update Student Detail.\" After reviewing the uploaded student details, you can approve or delete records as necessary. Any deleted records must be corrected and re-uploaded by someone with the UNMKR role.\n\n**For Department Operators:**\n\n- **Approving Student Payments**: After logging in with your DPTOPT credentials, click on the Payment tab and select \"Approve Student For Payment.\" Choose the university, review the verified student list, and approve those eligible for payment. This data will then be processed for payment.\n\n**For Students:**\n\n- **Registration**: Click on the provided URL to start your registration. Enter your university registration number, father\'s name, marksheet number, and proceed if the details are correct. You\'ll need to verify your Aadhaar, mobile number, and email through OTP authentication. Finally, enter your bank account and residential details before clicking on the \"Register\" button. Make sure all your details, especially Aadhaar, mobile, and email, are validated before you register.\n\nIn summary, this user manual provides clear steps for adding, verifying, and approving data related to colleges, courses, and students within the university system. For department operators, it guides through approving students for payment. And for students, it outlines the registration process, ensuring you\'re set up for success.\n\nNow that you\'ve heard the summary, please make sure to review the full document before proceeding. This will help you understand each step clearly and ensure a smooth process, regardless of your role. Thank you for your attention!\n\n\"key_sections\": [\n  {\n    \"section_name\": \"Introduction\",\n    \"pdf_text\": \"USER MANUAL\",\n    \"start_time\": 0,\n    \"end_time\": 10\n  },\n  {\n    \"section_name\": \"For Data Markers and Checkers\",\n    \"pdf_text\": \"Role: UNMKR, UNCHK. Action: Add College (UNMKR), Add Course (UNMKR), Add Student (UNMKR), Approve College (UNCHK), Approve Course (UNCHK), Approve Student (UNCHK).\",\n    \"start_time\": 10,\n    \"end_time\": 40\n  },\n  {\n    \"section_name\": \"For Department Operators\",\n    \"pdf_text\": \"Approve Student(Payment): Login with DPTOPT credential, Click on Payment tab, Click on Approve Student For Payment.\",\n    \"start