ick on Approve Student For Payment.\", \"start_time\": 40, \"section_name\": \"For Department Operators\"}, {\"end_time\": 60, \"pdf_text\": \"Registration: Click on the URL, Enter Your University Registration Number, Verify your Aadhaar, Mobile, Email, Enter Your bank account detail, Click on Register Button.\", \"start_time\": 50, \"section_name\": \"For Students\"}]'),
(112, 2, 1233, 'API', 'consent-forms/nWQNg756wfiL15ZjRJZIPRffg2YmPdl1ArXCUwuK.pdf', 'Hi there! Today, we\'re going to walk through something very important—your informed consent form for a neck lift surgery, also known as a lower rhytidectomy. It\'s crucial that you understand this document fully before moving forward, so let\'s break it down into simpler terms.', 'sent', 3, '{\"id\":\"chatcmpl-BxB1OLQFcpgQ0W4p9CRCiEElEzMcp\",\"object\":\"chat.completion\",\"created\":1753443418,\"model\":\"gpt-4-0125-preview\",\"choices\":[{\"index\":0,\"message\":{\"role\":\"assistant\",\"content\":\"Hi there! Today, we\'re going to walk through something very important\\u2014your informed consent form for a neck lift surgery, also known as a lower rhytidectomy. It\'s crucial that you understand this document fully before moving forward, so let\'s break it down into simpler terms.\\n\\n**Introduction to Informed Consent**\\nFirst off, informed consent is all about making sure you\'re fully in the loop about the surgery you\'re considering. This includes understanding what the surgery involves, the risks associated with it, and any other treatment options you might have. By initialing each page and signing the consent agreement, you\'re saying, \\\"Yes, I\'ve read all this information, and I agree to go ahead with the surgery we\'ve discussed.\\\"\\n\\n**General Information about Neck Lift Surgery**\\nA neck lift is a procedure aimed at addressing signs of aging in your jawline and neck area. It might involve removing excess fat, tightening loose skin, or correcting muscle banding in the neck to give you a more youthful appearance.\\n\\n**Exploring Other Treatment Options**\\nIt\'s important to know that there are alternatives to a neck lift, such as liposuction, facelifts, or skin resurfacing techniques like chemical peels or laser treatments. Each of these options comes with its own set of risks and considerations.\\n\\n**Understanding the Risks**\\nAll surgeries come with risks, and it\'s vital that you understand these as well as any other complications that might arise during or after your surgery. While complications are rare, knowing the potential risks helps you make an informed decision.\\n\\n**Specific Risks of Neck Lift Surgery**\\nSome specific risks include damage to facial nerves, which could affect muscle movement and facial symmetry, and changes to skin contours, which might necessitate further surgery.\\n\\n**Consent for Procedure or Treatment**\\nBy signing the consent form, you\'re allowing your surgeon and their team to perform the neck lift. You\'re also acknowledging that you understand the surgery\'s risks, benefits, and the possibility of needing additional treatments or interventions.\\n\\n**Understanding Your Rights and Responsibilities**\\nYou have the right to be informed about your surgery, including the potential outcomes and risks. Agreeing to anesthesia, understanding the use of blood products, and consenting to the disposal of any removed tissue are all part of this process. Additionally, you\'re agreeing to the financial aspects of your surgery.\\n\\nFinally, remember that not having the surgery is an option too. You\'re in control and can decide what\'s best for you.\\n\\n**To Summarize**\\nYou\'re considering a surgery that aims to rejuvenate your neck and jawline area. It\'s important to weigh the benefits against the risks and consider all your options. By signing the consent form, you\'re saying you understand and accept these terms.\\n\\nPlease make sure to review the full document carefully before signing. If you have any questions, now\'s the time to ask. We\'re here to make sure you feel confident and informed every step of the way.\\n\\n---\\n\\n```json\\n\\\"key_sections\\\": [\\n  {\\n    \\\"section_name\\\": \\\"Introduction to Informed Consent\\\",\\n    \\\"pdf_text\\\": \\\"This document is about informed consent. It will tell you about neck lift surgery. It will outline the risks and other treatments options.\\\",\\n    \\\"start_time\\\": 0,\\n    \\\"end_time\\\": 15\\n  },\\n  {\\n    \\\"section_name\\\": \\\"General Information about Neck Lift Surgery\\\",\\n    \\\"pdf_text\\\": \\\"A neck lift is a surgery to treat signs of aging in the jawline and neck. It is also called lower rhytidectomy.\\\",\\n    \\\"start_time\\\": 15,\\n    \\\"end_time\\\": 30\\n  },\\n  {\\n    \\\"section_name\\\": \\\"Exploring Other Treatment Options\\\",\\n    \\\"pdf_text\\\": \\\"Other treatment options are liposuction and facelifts. Skin resurfacing is also an option.\\\",\\n    \\\"start_time\\\": 30,\\n    \\\"end_time\\\": 40\\n  },\\n  {\\n    \\\"section_name\\\": \\\"Understanding the Risks\\\",\\n    \\\"pdf_text\\\": \\\"All surgeries have some risk. It is important that you know these risks.\\\",\\n    \\\"start_time\\\": 40,\\n    \\\"end_time\\\": 50\\n  },\\n  {\\n    \\\"section_name\\\": \\\"Specific Risks of Neck Lift Surgery\\\",\\n    \\\"pdf_text\\\": \\\"Damage to facial nerves: The surgery may harm branches of the facial nerve that control the muscles of the neck and lower lip.\\\",\\n    \\\"start_time\\\": 50,\\n    \\\"end_time\\\": 60\\n  },\\n  {\\n    \\\"section_name\\\": \\\"Consent for Procedure or Treatment\\\",\\n    \\\"pdf_text\\\": \\\"1.I permit Dr. Steve Sample and the doctor\\u2019s assistants to do the procedure Necklift (Lower Rhytidectomy).\\\",\\n    \\\"start_time\\\": 60,\\n    \\\"end_time\\\": 80\\n  },\\n  {\\n    \\\"section_name\\\": \\\"Understanding Your Rights and Responsibilities\\\",\\n    \\\"pdf_text\\\": \\\"I agree to the anesthetics that are needed or helpful. I understand that all types of anesthesia have risks.\\\",\\n    \\\"start_time\\\": 80,\\n    \\\"end_time\\\": 100\\n  }\\n]\\n```\",\"refusal\":null,\"annotations\":[]},\"logprobs\":null,\"finish_reason\":\"stop\"}],\"usage\":{\"prompt_tokens\":2298,\"completion_tokens\":1041,\"total_tokens\":3339,\"prompt_tokens_details\":{\"cached_tokens\":0,\"audio_tokens\":0},\"completion_tokens_details\":{\"reasoning_tokens\":0,\"audio_tokens\":0,\"accepted_prediction_tokens\":0,\"rejected_prediction_tokens\":0}},\"service_tier\":\"default\",\"system_fingerprint\":null}', 30, '2025-07-25 11:36:57', '2025-07-25 13:15:54', '{\"status\":\"completed\",\"message\":\"Video generated and saved successfully.\",\"video_details\":{\"code\":100,\"data\":{\"callback_id\":null,\"caption_url\":\"\",\"created_at\":1753443588,\"duration\":16.998,\"error\":null,\"gif_url\":\"https:\\/\\/resource2.heygen.ai\\/video\\/c4f40f46904e4751a64bc91b03ee2575\\/gif.gif\",\"id\":\"c4f40f46904e4751a64bc91b03ee2575\",\"status\":\"completed\",\"thumbnail_url\":\"https:\\/\\/files2.heygen.ai\\/aws_pacific\\/avatar_tmp\\/4c0fe400b2794a60b84026be07a4b40f\\/c4f40f46904e4751a64bc91b03ee2575.jpeg?Expires=1754048508&Signature=cu6t6ACBLY-xPog-f~dIbAMOS5LA~TKM3XIAeBylB0HW3Pl6MgVaiwNrxpH7IeUszahI9nY14MHLfRE8skFe2ARErtokF6sAyV0gIRod65mkxhRgg-rn3XunTuBo1quKJF2jZ~zoNJfMopQen6Mj1wkoz~GbOnFvdpcYBTcCF4J6oGA6vf4yDoskRqCGpbR-Ba0rr2zrMSoRhArKDF2Fip9X80cln8uZfbVAiVn4CGII8EcxCSGb7bGQI8cAo3a4zy0Pp00MzGy~egE5c3SD4azHusmtN7M8kP3-mZbwhm--h10JJfJjSokBGtOsYI5ir82tblkFAZY5wEFLH54iJA__&Key-Pair-Id=K38HBHX5LX3X2H\",\"video_url\":\"https:\\/\\/files2.heygen.ai\\/aws_pacific\\/avatar_tmp\\/4c0fe400b2794a60b84026be07a4b40f\\/c4f40f46904e4751a64bc91b03ee2575.mp4?Expires=1754048508&Signature=NC1t-j-ql8hz3cjEjYx1arCusC8ohDXvotM3iX~lcEunwZo6TEvZtJ8wFBlUYO1KTaTy6F21YvSHF3HNNXchtfDNfFdxtdizwRqqm5pUrQp0nJV0pPK7IHXtH56yCSpWJ7EdkqnBJF2gReHZT7ySTi83GJoQpTz7T1xjUwGQJWoUn4qGTjlX4RG9boTjhxghgHcGIVOwvtm7f1MDE1ijfcl3RzqlVxDb-NISblypUYai5pZAeRwreR97vz2wqBhV2FTc2HYH-r0GL5fd6uMICgFkiCVVx42mn0fOqQWgRPljSmqNGWIKbuPy2Lx1MOGngDsadsooSQ8hVaAX0L9xoA__&Key-Pair-Id=K38HBHX5LX3X2H\",\"video_url_caption\":null},\"message\":\"Success\"}}', NULL, NULL, NULL),
(113, 2, 1233, 'Consent Form Demo', 'consent-forms/QdBXykduj8flduYsmC3chkPtqELslAaowg92Ah2J.pdf', 'Hi there! Let\'s walk you through this agreement so you know exactly what to expect when considering a neck lift, also known as a lower rhytidectomy. We aim to make this clear and simple for you.\n\nA neck lift is a surgical method aimed at addressing signs of aging around the jawline and neck. This might include removing excess fat, tightening loose skin, or even correcting muscle banding that can appear in the neck area.\n\n\n---\n\n\"key_sections\": [\n  {\n    \"section_name\": \"Introduction\",\n    \"pdf_text\": \"This document is about informed consent. It will tell you about neck lift surgery.\",\n    \"start_time\": 0,\n    \"end_time\": 10\n  },\n  {\n    \"section_name\": \"Considering Other Options\",\n    \"pdf_text\": \"Other treatment options are liposuction and facelifts. Skin resurfacing is also an option.\",\n    \"start_time\": 10,\n    \"end_time\": 20\n  },\n  {\n    \"section_name\": \"Understanding the Risks\",\n    \"pdf_text\": \"All surgeries have some risk. It is important that you know these risks.\",\n    \"start_time\": 20,\n    \"end_time\": 30\n  },\n  {\n    \"section_name\": \"The Importance of Informed Consent\",\n    \"pdf_text\": \"Informed consent documents give you information about a surgery you are considering.\",\n    \"start_time\": 30,\n    \"end_time\": 40\n  },\n  {\n    \"section_name\": \"Your Agreement\",\n    \"pdf_text\": \"1.I permit Dr. Steve Sample and the doctor’s assistants to do the procedure Necklift (Lower Rhytidectomy).\",\n    \"start_time\": 40,\n    \"end_time\": 60\n  }\n]', 'sent', 3, '{\"id\":\"chatcmpl-BxFJbZ8UlO4GeWiJ4eVOY3w9juyZt\",\"object\":\"chat.completion\",\"created\":1753459923,\"model\":\"gpt-4-0125-preview\",\"choices\":[{\"index\":0,\"message\":{\"role\":\"assistant\",\"content\":\"Hi there! Let\'s walk you through this agreement so you know exactly what to expect when considering a neck lift, also known as a lower rhytidectomy. We aim to make this clear and simple for you.\\n\\n**Introduction to the Procedure**  \\nA neck lift is a surgical method aimed at addressing signs of aging around the jawline and neck. This might include removing excess fat, tightening loose skin, or even correcting muscle banding that can appear in the neck area.\\n\\n**Considering Other Options**  \\nBefore deciding, it\'s crucial to know there are alternatives. These range from liposuction, facelifts, to skin-resurfacing techniques like chemical and laser-assisted peels. Each option carries its unique set of risks and benefits.\\n\\n**Understanding the Risks**  \\nAll surgeries come with risks, and it\'s important to weigh these against the potential benefits. In the case of neck lift surgery, specific concerns might include damage to facial nerves, which could affect facial movements, or changes in skin contours that may need additional surgeries to correct.\\n\\n**The Importance of Informed Consent**  \\nInformed consent documents, like this one, are designed to give you a detailed overview of what the surgery involves, including the risks and alternative treatments. They\'re not exhaustive but aim to provide a solid foundation of understanding. Your surgeon will provide more personalized information based on your specific situation.\\n\\n**Your Agreement**  \\nBy signing the consent form, you\'re acknowledging:\\n1. You allow the designated surgeon and their team to perform the neck lift.\\n2. You\'ve received and understood information about the surgery, including that unexpected situations may arise requiring different procedures.\\n3. You understand the potential outcomes, realistic or otherwise, and accept the risks and benefits involved.\\n4. You consent to the use of anesthesia, understanding its risks.\\n5. You\'re aware of and consent to the possible use of blood products and the disposal of any tissues or parts removed during the operation.\\n6. You\'re okay with medical photography and the presence of medical students for educational purposes.\\n7. You agree to the associated charges and understand the billing process, including additional costs that might arise from unforeseen procedures.\\n\\nFinally, you acknowledge the option to not undergo the surgery.\\n\\nNow that you\'ve heard the summary, please make sure to review this document fully and ask your surgeon any lingering questions before signing. Your understanding and consent are crucial to us. Thank you for taking the time to go through this important information.\\n\\n---\\n\\n\\\"key_sections\\\": [\\n  {\\n    \\\"section_name\\\": \\\"Introduction\\\",\\n    \\\"pdf_text\\\": \\\"This document is about informed consent. It will tell you about neck lift surgery.\\\",\\n    \\\"start_time\\\": 0,\\n    \\\"end_time\\\": 10\\n  },\\n  {\\n    \\\"section_name\\\": \\\"Considering Other Options\\\",\\n    \\\"pdf_text\\\": \\\"Other treatment options are liposuction and facelifts. Skin resurfacing is also an option.\\\",\\n    \\\"start_time\\\": 10,\\n    \\\"end_time\\\": 20\\n  },\\n  {\\n    \\\"section_name\\\": \\\"Understanding the Risks\\\",\\n    \\\"pdf_text\\\": \\\"All surgeries have some risk. It is important that you know these risks.\\\",\\n    \\\"start_time\\\": 20,\\n    \\\"end_time\\\": 30\\n  },\\n  {\\n    \\\"section_name\\\": \\\"The Importance of Informed Consent\\\",\\n    \\\"pdf_text\\\": \\\"Informed consent documents give you information about a surgery you are considering.\\\",\\n    \\\"start_time\\\": 30,\\n    \\\"end_time\\\": 40\\n  },\\n  {\\n    \\\"section_name\\\": \\\"Your Agreement\\\",\\n    \\\"pdf_text\\\": \\\"1.I permit Dr. Steve Sample and the doctor\\u2019s assistants to do the procedure Necklift (Lower Rhytidectomy).\\\",\\n    \\\"start_time\\\": 40,\\n    \\\"end_time\\\": 60\\n  }\\n]\",\"refusal\":null,\"annotations\":[]},\"logprobs\":null,\"finish_reason\":\"stop\"}],\"usage\":{\"prompt_tokens\":2298,\"comple