(31, 2, 113, '51ef560ee6eb46f08a5ec8541f29a5e7', 'Consent Form 113', 'Generated video for consent form 113', '99.153', 'http://consentai.gaincafe.com/storage/heygen_videos/31_1753460224.mp4', 'completed', 'https://files2.heygen.ai/aws_pacific/avatar_tmp/4c0fe400b2794a60b84026be07a4b40f/51ef560ee6eb46f08a5ec8541f29a5e7.jpeg?Expires=1754065024&Signature=TE12KsgCOh7N7DKxcyBgM6E0jQtYDBzTrrtGZ5y1eAqNIGxY3qeGg3DGcNPDpi-X0CP7jMMUwWzP-RIMTOf~nCXIJEJxP~oEh3zv4ol8JIe9VU73GDH49QBW8Flj4ZM02Nvi3TP3vwW-FBE0eeddkeVfYSURqCilQf-Hxy8ZxyYDBmzb6XoB8-4WQOfWWJIOQ9PfaufPA473eWihRTdwyHIKWRlW3erm8sCDv24Rfi9RPpdL4RDP8dLIMPwEirmBCnynZbKBsEvq-xZe~ft-dJThqNX4fKbU97-QBd5ujCTaQEMrsWElXg3ZmVArdLpQHbUwnGDGVzE6Tj7bPUH3TQ__&Key-Pair-Id=K38HBHX5LX3X2H', NULL, '{\"request_data\":{\"title\":\"Consent Video for Form 113\",\"video_inputs\":[{\"character\":{\"type\":\"avatar\",\"avatar_id\":\"8bbee182a5c64cdd878f4506185d6509\",\"avatar_style\":\"normal\"},\"voice\":{\"type\":\"text\",\"input_text\":\"Hi there! Let\'s walk you through this agreement so you know exactly what to expect when considering a neck lift, also known as a lower rhytidectomy. We aim to make this clear and simple for you.\\n\\nA neck lift is a surgical method aimed at addressing signs of aging around the jawline and neck. This might include removing excess fat, tightening loose skin, or even correcting muscle banding that can appear in the neck area.\\n\\n\\n---\\n\\n\\\"key_sections\\\": [\\n  {\\n    \\\"section_name\\\": \\\"Introduction\\\",\\n    \\\"pdf_text\\\": \\\"This document is about informed consent. It will tell you about neck lift surgery.\\\",\\n    \\\"start_time\\\": 0,\\n    \\\"end_time\\\": 10\\n  },\\n  {\\n    \\\"section_name\\\": \\\"Considering Other Options\\\",\\n    \\\"pdf_text\\\": \\\"Other treatment options are liposuction and facelifts. Skin resurfacing is also an option.\\\",\\n    \\\"start_time\\\": 10,\\n    \\\"end_time\\\": 20\\n  },\\n  {\\n    \\\"section_name\\\": \\\"Understanding the Risks\\\",\\n    \\\"pdf_text\\\": \\\"All surgeries have some risk. It is important that you know these risks.\\\",\\n    \\\"start_time\\\": 20,\\n    \\\"end_time\\\": 30\\n  },\\n  {\\n    \\\"section_name\\\": \\\"The Importance of Informed Consent\\\",\\n    \\\"pdf_text\\\": \\\"Informed consent documents give you information about a surgery you are considering.\\\",\\n    \\\"start_time\\\": 30,\\n    \\\"end_time\\\": 40\\n  },\\n  {\\n    \\\"section_name\\\": \\\"Your Agreement\\\",\\n    \\\"pdf_text\\\": \\\"1.I permit Dr. Steve Sample and the doctor\\u2019s assistants to do the procedure Necklift (Lower Rhytidectomy).\\\",\\n    \\\"start_time\\\": 40,\\n    \\\"end_time\\\": 60\\n  }\\n]\",\"voice_id\":\"380120c151bd4fce82f20415033e14b9\"}}],\"test\":false,\"dimension\":{\"width\":1280,\"height\":720}},\"final_response\":{\"code\":100,\"data\":{\"callback_id\":null,\"caption_url\":\"\",\"created_at\":1753459983,\"duration\":99.153,\"error\":null,\"gif_url\":\"https:\\/\\/resource2.heygen.ai\\/video\\/51ef560ee6eb46f08a5ec8541f29a5e7\\/gif.gif\",\"id\":\"51ef560ee6eb46f08a5ec8541f29a5e7\",\"status\":\"completed\",\"thumbnail_url\":\"https:\\/\\/files2.heygen.ai\\/aws_pacific\\/avatar_tmp\\/4c0fe400b2794a60b84026be07a4b40f\\/51ef560ee6eb46f08a5ec8541f29a5e7.jpeg?Expires=1754065024&Signature=TE12KsgCOh7N7DKxcyBgM6E0jQtYDBzTrrtGZ5y1eAqNIGxY3qeGg3DGcNPDpi-X0CP7jMMUwWzP-RIMTOf~nCXIJEJxP~oEh3zv4ol8JIe9VU73GDH49QBW8Flj4ZM02Nvi3TP3vwW-FBE0eeddkeVfYSURqCilQf-Hxy8ZxyYDBmzb6XoB8-4WQOfWWJIOQ9PfaufPA473eWihRTdwyHIKWRlW3erm8sCDv24Rfi9RPpdL4RDP8dLIMPwEirmBCnynZbKBsEvq-xZe~ft-dJThqNX4fKbU97-QBd5ujCTaQEMrsWElXg3ZmVArdLpQHbUwnGDGVzE6Tj7bPUH3TQ__&Key-Pair-Id=K38HBHX5LX3X2H\",\"video_url\":\"https:\\/\\/files2.heygen.ai\\/aws_pacific\\/avatar_tmp\\/4c0fe400b2794a60b84026be07a4b40f\\/51ef560ee6eb46f08a5ec8541f29a5e7.mp4?Expires=1754065024&Signature=DL9oIQ-3ZHpmGCobw3pcjDLRNZBRqcMfe1E92CQVrscH9VUC3KjataA4ZHJ3Hv4mwvlHLgqr4GgH4-2Xs9sX9oTBOhb1NwfFYIZN2kIx1Hu5SGiogFA5Tk~nEINKjnVxN-Mo7